package utils

import (
	"github.com/google/uuid"
	"github.com/intel-secl/intel-secl-tee/v5/pkg/fda/models"
	"github.com/intel-secl/intel-secl-tee/v5/pkg/model/tcs"
	commLog "github.com/intel-secl/intel-secl/v5/pkg/lib/common/log"
)

var log = commLog.GetDefaultLogger()

func GetPlatformData(hostNumber string) (*models.SGXDiscoveryData, *models.TDXDiscoveryData, *models.HostData, *tcs.PlatformData, error) {
	log.Trace("utils/platform_info:GetPlatformData() Entering")
	defer log.Trace("utils/platform_info:GetPlatformData() Leaving")

	var hostData models.HostData
	var sgxData models.SGXDiscoveryData
	var tdxData models.TDXDiscoveryData
	var platformData tcs.PlatformData

	hostData.HostName = "Host" + hostNumber

	hostData.HardwareUuid = uuid.MustParse("00b61da0-5ada-e811-906e-00163566263e")
	platformData.HwUUID = hostData.HardwareUuid

	sgxData.SgxSupported = true
	sgxData.SgxEnabled = true
	sgxData.FlcEnabled = true

	sgxData.EpcOffset = "0x7020" + hostNumber
	sgxData.EpcSize = "189.5" + hostNumber + " MB"
	sgxData.SgxIntegrity = true

	tdxData.TdxSupported = true
	tdxData.TdxEnabled = true

	platformData.EncPpid = ""
	platformData.PceId = "0000"
	platformData.CpuSvn = "0202ffffff8002000000010000000000"
	platformData.PceSvn = "0a00"
	platformData.QeId = "b4772124b5929b96bb113c2c653b517c"
	platformData.Manifest = ""

	return &sgxData, &tdxData, &hostData, &platformData, nil
}
